import React, { Component } from 'react';

class ContactInfo extends Component {
	render() {
            return (
		<div id="contact-info" class="content-wrapper">
		    <h3>Contact Info</h3>
		    <ul>
			<li>E: <a href="mailto:amt@bath.ac.uk">amt83@bath.ac.uk</a></li>
		    </ul>
		</div>
            );
  	}
}

export default ContactInfo;
